import React from "react";


function YoutubeVideos(props) {
    return(
<div>
<p>{props.title}</p>

{/* <iframe src="{props.videoLink}"
        frameborder='0'
        allow='autoplay; encrypted-media'
        allowfullscreen
        title='video'
/> */}

<iframe src="https://www.youtube.com/embed/dQw4w9WgXcQ" 
title="YouTube video player" 
frameborder="0" 
allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
allowfullscreen
width="560" height="315">

</iframe>

<h3>{props.rating}</h3>

</div>
    );
}

export default YoutubeVideos;


<iframe width="884" height="497" src="https://www.youtube.com/embed/dQw4w9WgXcQ" title="Rick Astley - Never Gonna Give You Up (Official Music Video)" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
